import React, { useState, useEffect } from "react";

const CategoryView = () => {
    const [CatData, setCatData] = useState([]);
    const [loading, setLoading] = useState(true);
    const [query, setQuery] = useState("");

    useEffect(() => {
        fetch("http://localhost:3001/api/getcategory")
            .then((res) => res.json())
            .then((data) => setCatData(data))
            .catch((err) => console.error(err))
            .finally(() => setLoading(false));
    }, []);

    const DeleteCat = async (id) => {
        if (!window.confirm("Are you sure you want to delete this category?"))
            return;

        try {
            const res = await fetch(
                `http://localhost:3001/api/deletecategory/${id}`,
                { method: "DELETE" }
            );

            if (res.ok) {
                setCatData((prev) => prev.filter((c) => c.id !== id));
            } else {
                alert("Failed to delete category.");
            }
        } catch (err) {
            alert("Error deleting category.");
        }
    };

    return (
        <section className="section">
            <div className="text-center mb-4">
                <h2 className="section-title">Categories</h2>
                <p className="section-subtitle mx-auto">
                    Organize products with clean, searchable categories.
                </p>
            </div>

            <div className="d-flex flex-column flex-md-row gap-2 align-items-md-center justify-content-between mb-3">
                <input
                    type="search"
                    className="form-control"
                    placeholder="Search categories..."
                    value={query}
                    onChange={(e) => setQuery(e.target.value)}
                />
                <span className="text-muted small">
                    {CatData.filter((c) =>
                        c.category_name?.toLowerCase().includes(query.toLowerCase())
                    ).length} results
                </span>
            </div>

            <div className="card">
                <div className="table-responsive">
                    <table className="table align-middle mb-0">
                        <thead className="table-light">
                            <tr>
                                <th>#</th>
                                <th>Category Name</th>
                                <th className="text-end">Action</th>
                            </tr>
                        </thead>
                        <tbody>
                            {loading && (
                                <tr>
                                    <td colSpan="3" className="text-center py-4">
                                        <div className="skeleton-line w-60 mx-auto mb-2" />
                                        <div className="skeleton-line w-40 mx-auto" />
                                    </td>
                                </tr>
                            )}

                            {!loading &&
                                CatData.filter((c) =>
                                    c.category_name?.toLowerCase().includes(query.toLowerCase())
                                ).length === 0 && (
                                <tr>
                                    <td colSpan="3" className="text-center text-muted py-4">
                                        No categories found.
                                    </td>
                                </tr>
                            )}

                            {!loading &&
                                CatData.filter((c) =>
                                    c.category_name?.toLowerCase().includes(query.toLowerCase())
                                ).map((category, index) => (
                                    <tr key={category.id}>
                                        <td>{index + 1}</td>
                                        <td className="fw-semibold">
                                            {category.category_name}
                                        </td>
                                        <td className="text-end">
                                            <button
                                                className="btn btn-outline-danger btn-sm"
                                                onClick={() => DeleteCat(category.id)}
                                            >
                                                <i className="bi bi-trash"></i>
                                            </button>
                                        </td>
                                    </tr>
                                ))}
                        </tbody>
                    </table>
                </div>
            </div>
        </section>
    );
};

export default CategoryView;
